/**
 * @param {Function} functionComponent
 * @param {FunctionComponentOptions} options
 * @returns {string} Custom element tag name.
 */
export default function registerFunctionComponent(functionComponent: Function, { metaUrl, observedAttributes, name, shadowRootMode }?: FunctionComponentOptions): string;
export type FunctionComponentOptions = {
    metaUrl?: string;
    observedAttributes?: string[];
    name?: string;
    shadowRootMode?: ShadowRootMode;
};
